# LeetCode
# Easy
# 389. Find the Difference
# O(n)


s = ""
t = ""


# better way
def findTheDifference(s, t):
    s_sum = 0
    t_sum = 0
    for c in s:
        s_sum += ord(c)
    for c in t:
        t_sum += ord(c)

    return chr(t_sum - s_sum)


def find_the_difference(s, t):
    total = 0
    for c, g in zip(s, t):
        total += ord(g) - ord(c)
    total += ord(t[-1])
    return chr(total)

print(findTheDifference(s,t))
print(find_the_difference(s,t))
